import React, {Component} from 'react'
import axios from '../axios'

export default class Table2 extends Component {
    constructor(props) {
        super(props);
        this.state = {
            Users: []
        };
    }
    getUsersData() {
        axios
            .get(`http://localhost:5000/view`, {})
            .then(res => {
                const data = res.data
                console.log(data)
                const users = data.map(u =>
                    <div><table> 
                        <th>{u.name}</th>
                        <th>{u.email}</th>
                        <th>{u.work}</th>
                        <th>{u.phone}</th>
                        </table>
                    {/* <p>{u.name}</p>
                    <p>{u.phone}</p> */}
                    {/* <p>{u.name}</p>
                    <p>{u.email}</p>
                    <p>{u.website}</p>
                    <p>{u.company.name}</p> */}
                    </div>
                    )

                    this.setState({
                        users
                    })

            })
            .catch((error) => {
                console.log(error)
            })

    }
    componentDidMount(){
        this.getUsersData()
    }
    render() {

        return (
            <div>
               <p> {this.state.users}</p> 
            </div>
        )
    }
}
